import React from "react";
import { Link } from "react-router-dom";

const MainNavigation = () => {
  return (
    <div>
      <ul>
        <li>
          <Link to="/home">home</Link>
        </li>
      </ul>
    </div>
  );
};

export default MainNavigation;
